import './App.css';

function App() {
  return (
    <div className="App">
      <header>
        <h1>Archivist</h1>
        <h2>
          A Dungeons & Dragons 5th Edition<br />
          Character Creation and Leveling Companion App
        </h2>
      </header>
      <nav>
        <a>+ New Character</a>
      </nav>
    </div>
  );
}

export default App;
